import React from 'react';
import Coffeestart from './images/coffeestart.png'
import Coffee1shot from './images/coffee1shot.svg'
import Coffee2shots from './images/coffee2shots.svg'
import Coffee3shots from './images/coffee3shots.svg'
import Coffee4shots from './images/coffee4shots.svg'
import Coffee5shots from './images/coffee5shots.svg'
// import { Link } from 'react-router-dom'

class NuffCoffeeCup extends React.Component {


  render() {
    return(
            <div className="coffeecupcontainer">
                {<Coffeestart></Coffeestart>}
                {this.props.coffeecount===1 && <Coffee1shot></Coffee1shot>}
                {this.props.coffeecount===2 && <Coffee2shots></Coffee2shots>}
                {this.props.coffeecount===3 && <Coffee3shots></Coffee3shots>}
                {this.props.coffeecount===4 && <Coffee4shots></Coffee4shots>}
                {this.props.coffeecount===5 && <Coffee5shots></Coffee5shots>}
                {/* {this.props.coffeecount===6 && <img className="coffeecup" src={coffeecup} alt="nuffcoffeecup-6shot"/>}
                {this.props.coffeecount===7 && <img className="coffeecup" src={coffeecup} alt="nuffcoffeecup-7shot"/>}
                {this.props.coffeecount===8 && <img className="coffeecup" src={coffeecup} alt="nuffcoffeecup-8shot"/>}
                {this.props.coffeecount>8 && <img className="coffeecup" src={coffeecup} alt="nuffcoffeecup-8shot"/>} */}
            </div>)
  }
}
export default NuffCoffeeCup;
